import "../css/App.css";
import SearchBar from "./SearchBar";
import ListBooks from "./ListBooks";
import {Routes, Route} from "react-router-dom";

const shelves = [
    {
        id: "currentlyRead",
        name: "Currently Read"
    },
    {
        id: "wantToRead",
        name: "Want to Read"
    },
    {
        id: "read",
        name: "Read"
    }
];

function App() {
    return (
        <Routes>
            <Route exact path="/" element={
                <ListBooks shelves={shelves}/>
            }>
            </Route>

            <Route exact path="/search" element={
                <SearchBar/>
            }>
            </Route>
        </Routes>
        // <div className="app">
        //
        // </div>
    );
};

export default App;
